import { Box, Typography } from '@mui/material';

const HomeScreen = () => {
    return (
        <Box sx={{ backgroundColor: '#fff', height: '100vh', display: 'flex', justifyContent: 'center', alignItems: 'center', flexDirection: 'column' }}>
            <Typography variant="h4" sx={{ mb: 4 }}>Hoşgeldiniz, aradığınız her şey burada!</Typography>
            <Box sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
                <img src="https://source.unsplash.com/random/400x400?nature" alt="Nature" sx={{ mr: 2 }} />
                <img src="https://source.unsplash.com/random/400x400?technology" alt="Technology" />
            </Box>
        </Box>
    );
};

export default HomeScreen;
